import React, { useState, useEffect } from 'react';
import { getAll, deletePet } from '../../services/api'; // Asegúrate de que `deletePet` también esté implementado
import { useNavigate } from 'react-router-dom';
import '../../styles/AdminDashboard.css';

const AdminDashboard = () => {
  const [pets, setPets] = useState([]);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token'); // Obtener el token del localStorage

    if (!token) {
      navigate('/signin');
      return;
    }

    const fetchAllPets = async () => {
      try {
        const response = await getAll(token);  // Pasar el token en los encabezados
        setPets(response.data);
      } catch (err) {
        console.error('Failed to load pets.', err);
        setError('Failed to load pets. No pets found.');
      }
    };

    fetchAllPets();
  }, [navigate]);

  const getPetImage = (pet) => {
    const { petColor, petType, asleep } = pet;
    const imageSuffix = asleep ? '_SLEEPING' : '';
    return require(`../../assets/pets/${petType}_${petColor}${imageSuffix}.png`);
  };

  const handleDelete = (petId) => {
    const token = localStorage.getItem('token');
    if (token) {
      deletePet(token, petId)
        .then(() => {
          setPets(pets.filter(pet => pet.petId !== petId)); // Eliminar la mascota del estado
          console.log('Pet deleted successfully');
        })
        .catch((err) => {
          console.error('Error deleting pet:', err);
        });
    }
  };

  return (
    <div className="admin-dashboard">
      <div className="admindashboard-whimsy-logo-container">
        <h1 className="admindashboard-title-text">WhimsyGarden</h1>
      </div>
      {error && <p>{error}</p>}
      {pets.length > 0 ? (
        <div className="pets-container">
          {pets.map((pet) => (
            <div key={pet.petId} className="pet-card">
              <button
                className="delete-button"
                onClick={(e) => {
                  e.stopPropagation(); // Detiene la propagación del evento
                  handleDelete(pet.petId); 
                }}
              >
                <span className="delete-icon">X</span>
              </button>
              <div className="pet-image-container">
                <img
                  src={getPetImage(pet)}
                  alt={pet.petName}
                  className="pet-image"
                />
                <img
                  src={require(`../../assets/backgrounds/${pet.location}.jpg`)}
                  alt={`background of ${pet.petName}`}
                  className="pet-background-image"
                />
              </div>
              <div className="pet-name-container">
                <h2>{pet.petName}</h2>
              </div>
              <div className="pet-status">
                <div className="status-bar">
                  <label>Happiness</label>
                  <progress value={pet.happiness} max={100} />
                </div>
                <div className="status-bar">
                  <label>Hunger</label>
                  <progress value={pet.hunger} max={100} />
                </div>
              </div>
            </div>
          ))}
        </div>
      ) : (
        <p>No pets found. Please create a pet.</p>
      )}
      <button className="create-pet-button" onClick={() => navigate('/create-pet')}>
        Create New Pet
      </button>
      <button className="logout-button" 
        onClick={() => {
          localStorage.removeItem('token');
          localStorage.removeItem('userId');
          navigate('/signin');
        }}>
        Logout
      </button>
    </div>
  );
};

export default AdminDashboard;
